import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  'cards': {
    'padding': [{ 'unit': 'px', 'value': 5 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }, { 'unit': 'px', 'value': 0 }],
    'position': 'absolute',
    'width': [{ 'unit': '%H', 'value': 1 }],
    'zIndex': '1',
    'bottom': [{ 'unit': 'px', 'value': 20 }]
  },
  'cards__card': {
    'margin': [{ 'unit': 'px', 'value': 5 }, { 'unit': '%H', 'value': 0.03 }, { 'unit': 'px', 'value': 5 }, { 'unit': '%H', 'value': 0.03 }],
    'display': 'inline-block',
    'height': [{ 'unit': 'px', 'value': 50 }],
    'width': [{ 'unit': '%H', 'value': 0.15 }],
    'fontSize': [{ 'unit': 'px', 'value': 31 }],
    'alignItems': 'center'
  }
});
